    return {
        tasks: store.createTaskReducer.tasks
    }
}

const TaskCreateInputContainer = ({tasks}) => {
    console.log(Object.entries(tasks),'TASKS')
    const [key,value] = Object.entries(tasks)
    const task = Object.entries(tasks).map(task => task[1])

    console.log(task,'TAS')
    console.log(tasks,'TASKS')
    console.log(value,'VALUE')
    return (
        <div>
            tasks ?{
                task.map(task => {
                        return <div>{task.task}</div>
                    })
            }
            : <div>Create your first task and be better</div>
            {/*<TasksList tasks={tasks}/>*/}
        </div>
    )
};

export default connect(mapStateToProps,null)(TaskCreateInputContainer)
